import React from "react";
import axios from "axios";

const Auth = () => {
  const sendUserData = (uData: any) => {
    console.log(uData);
  };

  return (
    <div>
      <form onSubmit={(e) => sendUserData(e)}>
        <div id="u_name">
          <label htmlFor="name">Username:</label>
          <input name="name" type="text" />
        </div>

        <div id="u_pass">
          <label htmlFor="pass">Password</label>
          <input type="password" />
        </div>
      </form>
    </div>
  );
};

export default Auth;
